```python
class Node:
    def __init__(self,key,val):
        self.key=key
        self.val=val
        self.prev=None
        self.next=None
class LRUCache:

    def __init__(self, capacity: int):
        self.cap=capacity
        self.t={}
        self.beg=self.end=Node(0,0)
        self.beg.next=self.end
        self.end.prev=self.beg

    def append(self, n: Node) -> None:
        self.end.prev.next=n
        n.prev=self.end.prev
        n.next=self.end
        self.end.prev=n
        self.t[n.key]=n

    def remove(self, n: Node) -> None:
        n.prev.next=n.next
        n.next.prev=n.prev

    def get(self, key: int) -> int:
        if key not in self.t: return -1
        self.remove(n:=self.t[key])
        self.append(n)
        return n.val

    def put(self, key: int, value: int) -> None:
        if key in self.t:
            self.remove(self.t[key])
        elif len(self.t)>=self.cap:
            self.remove(n:=self.beg.next)
            del self.t[n.key]
        self.append(Node(key,value))
