class Solution:
    def isCousins(self, root: TreeNode, x: int, y: int) -> bool:
        def dfs(n: TreeNode, p: TreeNode, i: int, h: int):
            if not n: return None
            if n.val==i: return p,h
            return dfs(n.left,n,i,h+1) or dfs(n.right,n,i,h+1)
        px,hx=dfs(root,None,x,0)
        py,hy=dfs(root,None,y,0)
        return hx==hy and px!=py
