class Solution {
public:
    int singleNonDuplicate(const vector<int>& nums) {
        int l = 0, r = nums.size() - 1, mid = 0;
        while(l < r)
        {
            mid = l + (r - l)/2;
            if(mid - 1 >= 0 && nums[mid] == nums[mid - 1])
            {
                if(mid % 2 == 0)
                    r = mid;
                else
                    l = mid + 1;
                continue;
            }
            if(mid + 1 < nums.size() && nums[mid] == nums[mid + 1])
            {
                if((mid + 1) %2 == 0)
                    r = mid;
                else
                    l = mid + 1;
                continue;
            }
            break;
        }
        return nums[(l+r)/2];
    }
};
