class Node {
    public:
    char c;
    unordered_map<char, Node*> children;
    bool isword;

    Node()
    {
        c = ' ';
        isword = false;
    }

    void insert(string & word, int i)
    {
        if(i == word.size())
        {
            this->isword = true;
            return;
        }
        if(children.find(word[i]) == children.end())
        {
            children[word[i]] = new Node();
            children[word[i]]->c = word[i];
        }
        children[word[i]]->insert(word, i + 1);
    }

    bool search(string & word, int i)
    {
        if(i == word.size())
            return this->isword;

        if(children.find(word[i]) != children.end())
            return children[word[i]]->search(word, i + 1);
        else
            return false;
    }

    bool startsWith(string & pre, int i)
    {
        if(i == pre.size())
            return true;

        if(children.find(pre[i]) == children.end())
            return false;
        else
            return children[pre[i]]->startsWith(pre, i + 1);
    }
};

class Trie {
public:
    Node * head;
    Trie() {
        head = new Node();
    }

    void insert(string word) {
        head->insert(word, 0);
    }

    bool search(string word) {
        return head->search(word, 0);
    }

    bool startsWith(string prefix) {
        return head->startsWith(prefix, 0);
    }
};
