```
class Solution {
public:
    int maxSubarraySumCircular(vector<int>& A) {
        int ssum = 0, bsum = 0, csum = 0, maxsum = A[0], minsum = A[0], sz = A.size();
        for(int i = 0; i < sz; ++i)
        {
            csum += A[i];
            bsum += A[i];
            ssum += A[i];
            maxsum = max(bsum, maxsum);
            minsum = min(ssum, minsum);
            if(bsum < 0)
                bsum = 0;
            if(ssum > 0)
                ssum = 0;
        }
        return maxsum > 0 ? max(maxsum, csum - minsum) : maxsum; 
    }
};
