TreeNode* bstFromPreorder(vector<int>& preorder) 
    {
        int sz = preorder.size(), i = 1;
        if(sz == 0)
            return nullptr;
        stack<TreeNode*> st;
        TreeNode * head, * ptr;
        head = new TreeNode(preorder[0]);
        st.push(head);
        while(i < sz)
        {
            ptr = st.top();
            if(preorder[i] < ptr->val)
            {
                ptr->left = new TreeNode(preorder[i]);
                st.push(ptr->left);
            }
            else
            {
                while(!st.empty() && st.top()->val < preorder[i])
                {
                    ptr = st.top();
                    st.pop();
                }
                ptr->right = new TreeNode(preorder[i]);
                st.push(ptr->right);
            }
            ++i;
        }
        return head;
    }
