class Solution:
    def possibleBipartition(self, N: int, dislikes: List[List[int]]) -> bool:
        graph=[[] for _ in range(N+1)]
        vis=defaultdict(int)
        def visit(i: int, length: int):
            if i in vis:
                return (length-vis[i])%2==0
            vis[i]=length
            for v in graph[i]:
                if not visit(v,length+1):
                    return False
            return True        
        for i,j in dislikes:
            graph[i].append(j)
            graph[j].append(i)         
        for i in range(1,N+1):
            if i in vis: continue
            if not visit(i,0):
                    return False
        return True
