class Node:
    def __init__(self,word=None):
        self.children={}
        self.word=word
class Solution:
    def makeTrie(self,head,words):
        for s in words:
            cur=head
            for c in s:
                if c not in cur.children:
                    cur.children[c]=Node()
                cur=cur.children[c]
            cur.word=s

    def findWords(self, board: List[List[str]], words: List[str]) -> List[str]:
        r,c=len(board),len(board[0])
        visited=[[False for _ in range(c)] for __ in range(r)]
        found=set()

        head=Node()
        self.makeTrie(head,words)

        def neighbors(i,j):
            return [(a,b) for a in range(i-1,i+2) for b in range(j-1,j+2) \
                    if ((i!=a or j!=b) and 0<=i<r and 0<=j<c and 0<=a<r and 0<=b<c) \
                   and abs(a+b-(i+j))==1]
        def visit(node,i,j):
            visited[i][j]=True
            if node.word:
                found.add(node.word)
            for a,b in neighbors(i,j):
                if not visited[a][b] and board[a][b] in node.children:
                    visit(node.children[board[a][b]],a,b)            
            visited[i][j]=False 

        for i in range(r):
            for j in range(c):
                if board[i][j] in head.children:
                    visit(head.children[board[i][j]],i,j)
        return list(found)
