class Solution {
    func isSubsequence(_ s: String, _ t: String) -> Bool {
        let s = Array(s), t = Array(t)
        var sequencePointer = 0, mainPointer = 0
        while sequencePointer < s.count && mainPointer < t.count {
            if s[sequencePointer] == t[mainPointer] {
                sequencePointer += 1
            }
            mainPointer += 1
        }
        return sequencePointer == s.count
    }
}
