class Solution:
    def searchInsert(self, nums: List[int], target: int) -> int:
        if not nums or (n:=len(nums))==0: return 0
        l,r=0,n-1
        while l<=r:
            m=(l+r)//2
            if nums[m]==target:
                return m
            if target>nums[m]:
                l=m+1
            else:
                r=m-1
        return l 
