class Solution {
    func sortColors(_ nums: inout [Int]) {
        var f = 0, m = 0, l = nums.count - 1, i = 0
        while m <= l {
            if nums[m] < 1 {
                nums.swapAt(f, m)
                f += 1
                m += 1
            } else if nums[m] > 1 {
                nums.swapAt(l, m)
                l -= 1 
            } else {
                m += 1
            }
            i += 1
        }
    }
}
