class RandomizedSet:
    def __init__(self):
        self.set=[]
        self.inds={}

    def insert(self, val: int) -> bool:
        if val not in self.inds:
            self.set.append(val)
            self.inds[val]=len(self.set)-1
            return True
        return False


    def remove(self, val: int) -> bool:
        if val in self.inds:
            ind=self.inds[val]
            if ind!=len(self.set)-1:
                self.set[ind]=self.set[-1]  
                self.inds[self.set[-1]]=self.inds[val]
            self.set.pop()
            del self.inds[val]
            return True
        return False

    def getRandom(self) -> int:
        return random.choice(self.set)
