```swift
class RandomizedSet {
    private var set: [Int]
    private var map: [Int: Int]

    init() {
        self.set = [Int]()
        self.map = [Int:Int]()
    }

    func insert(_ val: Int) -> Bool {
        if map[val] != nil{
           return false
        }
        set.append(val)
        map[val] = set.count - 1
        return true
    }

    func remove(_ val: Int) -> Bool {
        if map[val] == nil{
          return false
        }
        var last = set.last!
        var index = map[val]!
        set[index] = last
        map[last] = index
        set.removeLast()
        map[val] = nil
        return true
    }

    func getRandom() -> Int {
        var index = Int.random(in: 0 ..< set.count)
        return set[index]
    }
}
