from collections import defaultdict
import heapq
class Solution:
    def findCheapestPrice(self, n: int, flights: List[List[int]], src: int, dst: int, K: int) -> int:
        g=defaultdict(dict)
        for u,v,w in flights:
            g[u][v]=w
        pq=[(0,src,K)]
        while pq:
            p,u,k=heapq.heappop(pq)
            if u==dst: return p
            if k>=0:
                for v in g[u]:
                    heapq.heappush(pq,(p+g[u][v],v,k-1))
        return -1
```
