class Solution:
    def validIPAddress(self, IP: str) -> str:
        def v4(s):
            try:
                return 0<=int(s)<=255 and str(int(s))==s
            except: return False
        def v6(s):
            try: 
                return 0<=int(s,16)<=65535 and len(s)<=4 and s[0]!='-'
            except: return False
        if len(ip:=IP.split('.'))==4 and all(v4(s) for s in ip):
            return 'IPv4'
        if len(ip:=IP.split(':'))==8 and all(v6(s) for s in ip):
            return 'IPv6'
        return 'Neither'
